import React from 'react';
import styled from 'styled-components'; 

function Navbar() {
    return (
        <>
           <Container>
                <Logo>
                    <h2>ThapaTechnical</h2>
                </Logo>
           </Container>
        </>
    )
}

const Container = styled.div`
    display:flex;
`

export default Navbar;
